import { SET_CURRENT_USER } from "../actions/authActions";

const initialState = {
  isAuthenticated: false,
  user: {},
  token:''
};

export default (state = initialState, action) => {
  switch (action.type) {
    case SET_CURRENT_USER:
      return {
        isAuthenticated: !!Object.keys(action.user).length,
        user: action.user
      };
    default:
      return state;
  }
};
